import ReactDOM from 'react-dom/client';
import  AuthContext from './Store/AuthContext';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
<AuthContext.Provider>
    <App />
</AuthContext.Provider>
 );
